$('.element').dragster({
    enter: function (dragsterEvent, event) {
        $(this).addClass('hover');
    },
    leave: function (dragsterEvent, event) {
        $(this).removeClass('hover');
    },
    drop: function (dragsterEvent, event) {
        $(this).removeClass('hover');
    }
});
